import React, { useEffect, useState } from 'react';
import { apiCall } from '../utils/apiCall';

function Adminpage() {

    const [advertises, setAdvertises] = useState([]);

    useEffect(()=>{
        getAdminAdvertise();
    }, [])
    
    function getAdminAdvertise(){
        apiCall('/api/lost/admin-page', 'get').then(res=>{
            setAdvertises(res.data);
            console.log(res.data);
        })
    }

    return (
        <div>
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>t/r</th>
                            <th>firstname</th>
                            <th>lastname</th>
                            <th>age</th>
                            <th>phone number</th>
                            <th>description</th>
                            <th>registry</th>
                            <th>status</th>
                        </tr>
                    </thead>
                </table>
            </div>
        </div>
    );
}

export default Adminpage;
